  input: '"TEXT","F3T","C00385641","This is the termination report for the Friends
    of Bob Barr committee.  Refunds for Primary election contributions exceeding net
    debts outstanding and received after the withdrawal announcement have been made
    and copies will be mailed via USPS to the Commission.  There were two refunds
    issued several months ago that were never cashed and a negative refund has been
    entered on this report to reflect that.  Because of this negative entry, the refund
    total on the detailed summary page is less than the itemized total of the check
    copies you will receive.  The remaining funds have been contributed to a qualified
    501(c) 3 organization.  I look forward to receiving the official acceptance of
    this filing from the Commission and the termination of this committee.  Thank
    you, Friends of Bob Barr."'
